        public static IEnumerable<MyPrefabConfiguration> GetPrefabConfigurations()
        {
            foreach (var item in m_prefabConfigurations)
            {
                //yield return item.Value;
                foreach (MyPrefabConfiguration prefabConfiguration in item)
                {
                    yield return prefabConfiguration;
                }
            }
        }
